INSERT INTO `Blog` VALUES (12,'The Future of Procurement Arrives at Last  Digital technologies are on pace to automate most routine procurement processes within three to five years.','<p>In many ways, today&rsquo;s procurement organizations resemble white-collar versions of manufacturing in the 1970s. Manual processes still dominate procurement, even as automation transforms other business functions. Legions of staffers handle low-value sourcing and demand-management activities at the bottom of The Purchasing Chessboard, where they have more leverage over suppliers or the ability to influence users (see figure 1). Routine, labor-intensive transactional activities&mdash;pricing negotiations, contract awards, supplier performance monitoring&mdash;consume time and attention. Procurement workers also spend hours piecing together fragmented information flows from myriad transactions, a task technology could perform in seconds. Internal stakeholders, meanwhile, grow frustrated by what they perceive as slow service from procurement, and yearn for self-service options and direct access to end-to-end data streams.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','Technology','0001-01-01 00:00:00','System','2019-01-23 19:02:38','System','','Iwgd4Re1CE2hKF51Uq7dYA==','https://www.atkearney.com/procurement/article?/a/the-future-of-procurement-arrives-at-last'),(13,'Building superior capabilities for strategic sourcing','<p><strong>Jack Welch</strong>&nbsp;once notoriously said that &ldquo;engineers who can&rsquo;t add, operators who can&rsquo;t run their equipment, and accountants who can&rsquo;t foot numbers become purchasing professionals.&rdquo; Hyperbole aside, General Electric&rsquo;s legendary boss was reflecting a common perception: the purchasing function is little more than a necessary evil in business. No surprise, then, that many companies underinvest in the purchasing team&rsquo;s capabilities and leave sourcing out of strategic decision-making processes in favor of functions, such as manufacturing and sales, that drive revenue.</p>\r\n','Construction','2019-01-23 19:07:45','System','2019-01-23 19:07:45','System','','C52ZXmWh+kSfyVmXT353UA==','https://www.mckinsey.com/business-functions/operations/our-insights/building-superior-capabilities-for-strategic-sourcing'),(14,'Procurement 4.0: Are you ready for the digital revolution?','<p><strong>Some call it &ldquo;digitalization,&rdquo;</strong>&nbsp;some call it &ldquo;smart manufacturing,&rdquo; and others call it &ldquo;the next industrial revolution&rdquo; or &ldquo;Industry 4.0.&rdquo; Whatever term you use, a combination of new technologies&nbsp;&mdash; from big data analytics to 3D printing&nbsp;&mdash; is revolutionizing companies&rsquo; operational and administrative processes and creating innovative digital products and services.</p>\r\n\r\n<p>Reflecting the effects of Industry 4.0&rsquo;s cutting-edge technologies and data management on strategic and operational procurement, the additional concept of &ldquo;Procurement 4.0&rdquo; has recently emerged. What does Procurement 4.0 entail? And should it be the strategic compass for chief procurement officers in the foreseeable future? There are many opinions, and every company will ultimately require its own strategy and trajectory as it takes on both the challenges and the opportunities that come with advanced procurement.</p>\r\n\r\n<p>In industries across the board, however, companies need to consider the way digital innovation will disrupt not only the way their organizations work today, but the entire value proposition of procurement to their suppliers, customers, and internal process partners. In this report we offer a framework for adapting to the organizational changes that a 21st-century approach to procurement will require.</p>\r\n','Technology','2019-01-23 19:09:50','System','2019-01-23 19:09:50','System','','2k0WPQ1lA0yWGN5u+rfnEw==','https://www.strategyand.pwc.com/report/procurement-4-digital-revolution'),(15,'Best Practice guide - Five things in procurement','<p>In many government and commercial organisations procurement has now become recognised as a fundamental enabler of business strategy and a preferred method for achieving sustainable cost reduction. It is often a source of opportunity for process simplification with technology enablement and a window into understanding what is really going on in operations through data and information. Based on our experience in working with organisations to improve their procurement outcomes, we believe that there are, at a minimum, five thingsyou should expect from your procurement function right now. If you are unable to &lsquo;tick these boxes&rsquo; chances are that money is being left on the table, commercial decisions are being made in isolation from the business and antiquated processes and systems are a barrier to realising the full potential that procurement can deliver. Furthermore, compliance to strategy and process will be encumbered by the increasing cost to change.</p>','Procurement','2019-01-23 19:19:51','System','2019-01-23 19:19:51','System','','Dj3xnUuv5EaKp3JY9x1g1g==','https://www.ey.com/Publication/vwLUAssets/EY-best-practice-guide-five-things-in-procurement/$File/EY-best-practice-guide-five-things-in-procurement.pdf');
/*!40000 ALTER TABLE `Blog` ENABLE KEYS */;
