ojectTitle] ','To [BuyerOwnerX], ','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(22,'RFQ_Review','RFQ Review: Invitation to Review RFQ for [ProjectTitle] ','To [InvitationUserName], ','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(23,'RFQ_Withdrawn','RFQ Withdrawn: [ProjectTitle] by [BuyerCompanyX] ','To [SupplierOwnerX], <br><br> [BuyerCompanyX] withdrawn their RFQ titled [ProjectTitle].  <br><br>Regards, <br><br>EzyTender Team <br>Email: Support@EzyTender.com <br>Tel: +65 6519 0961 ','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(24,'RFQ_Interested','RFQ Interested: [ProjectTitle] by [SupplierCompanyX] ','To [BuyerOwnerX], <br><br> [SupplierCompanyX] has interested your RFQ titled [ProjectTitle].  <br><br>Regards, <br><br>EzyTender Team <br>Email: Support@EzyTender.com <br>Tel: +65 6519 0961 ','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(25,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(26,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(27,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(28,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(29,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(30,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(31,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(32,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL),(33,'a','d','d','2019-04-03 00:00:00','system','2019-04-03 00:00:00','system','',NULL);
