INSERT INTO `Penalty` VALUES (103,131,'Delay in Performance',NULL,'If there is delay in the performance of the Services or the supply of Goods due to any acts of God, force majeure, riots and civil commotion, strikes, lock-outs or other causes or perils beyond the Supplier\'s control, then in any such case the Supplier shall, for the duration of any such circumstances, be relieved of the obligation to perform the Services or supply the Goods thereby affected. Any part of the Services or Goods that are not so affected shall continue to be performed in accordance with the Agreement. If the Supplier fails to complete the performance of Services or supply of Goods by the date(s) specified in the Agreement, The Buyer shall have the right - (a) to cancel all or any part of such Services or Goods from the Agreement without compensation to the Supplier and to obtain the same (including similar or equivalent goods and services in the case where the exact goods and services are not available) from other sources and all increased costs incurred shall be deducted from any moneys due or to become due to the Supplier or shall be recoverable as damages; or (b) to deduct any moneys due or to become due to the Supplier or require the Supplier to pay a sum calculated at the rate of 0.5% of the Contract Price for each day of delay (including Sundays and Public Holidays), as liquidated damages until the delayed Services or Goods are fully performed or supplied; up to a maximum amount of liquidated damages equivalent to 20% of the Contract Price. This maximum amount is based on the aggregate of all liquidated damages imposed for all cases of delay during the entire period of the Agreement and is not the maximum sum for each individual case of delay. ','2019-04-20 05:50:42','a','2019-04-20 05:50:42','a','','AuVUuMaBik6WwCHz+OW7Xg=='),(104,132,'Commercial One',NULL,'Commercial Two','2019-04-20 06:17:08','a','2019-04-20 06:17:08','a','','BLp2elxy9Ua/Mm0fAXwt/A=='),(105,133,'Name',NULL,'D